import './Deckcard.css';
import styled from 'styled-components';

class DeckCard extends Component {
    constructor(props) {
        super(props)
        this.state = {
            localDeckName: "Deck Name"
        }
    }

    newPageHandler = () => {
        console.log("Time to go forward!");
    }

    prevPageHandler = () => {
        console.log("Time to go back!");
    }

    render() {
        return (
            <div className = "DeckCard">
                <div className="DeckCardInner">
                    <div className="Dot"></div>
                    <div className="DeckName">{this.state.localDeckName}</div>
                    <button className="DownloadButton" src={`./DownloadButton.png`}></button>
                </div>
            </div>
        )
    }
}




export default DeckCard
